import Row from "react-bootstrap/Row";

import SingleBook from "../components/SingleBook";

function BookList(props) {
  return (

    <Row className="g-5">
      {props.genre.map((book) => (
        <SingleBook book={book} />
      ))}
    </Row>
  );
}

export default BookList;
